                        </Col>
                    </Row>
                </Row>
                <Row size={1}>
                    <Text>
                        ABC
                    </Text>
                </Row>
            </Grid>
    );
}



const DashboardText = styled.Text`
    fontSize: ${moderateScale(22,0.4)};
    color:azure;
    align-content: center;
 `

const dashboardStyle = StyleSheet.create({
        container: {
            display: 'flex',
